import React from 'react';

class GoogleAuth extends React.Component {

  componentDidMount(){
    window.gapi.load('client:auth2', () => {
      window.gapi.init({
        clientId: '106672197064-n2cs5drmeok3sdp9jqjaeid64ocbbkr0.apps.googleusercontent.com',
        scope: 'email'
      })
    })
  }

  render(){
    return(
      <div>
        Google Auth
      </div>
    );
  }
}

export default GoogleAuth;
